data.text:
@meiermq Un suicida ... cobarde
Dejo millonarios a los deudos
Lo peor...sus lacras...lo hacen mártir.

Seguimos con la serie de reseñas de la etapa de @TomKingTK al frente de Batman. Hoy @Jc_Grayson nos habla de "Yo soy suicida" en el que, a través del arte de @mikeljanin, nos cuentan una magnífica historia con Bane en Santa Prisca. 

@eccediciones.

https://t.co/RHUeBWypPq

@InformativosTM La depresión y los problemas mentales ya se presupone en un suicida. 

Así que deberemos pensar que este titular tiene alguna intención adicional.

Alguna intención vergonzante e inconfesable, para más señas.

